    def findSubstring(s, words):
        if s == words[0] and len(words) == 1:
            return [0]

        substringIndexes = []
        wordLen = len(words[0])
        lenS = len(s)

        i = 0
        while (i < len(s) - wordLen):
            copy = words[:]
            foundWords = {}

            for j in range(i, lenS, wordLen):
                wordBeingChecked = s[j:j + wordLen]

                if wordBeingChecked in copy:
                    copy.pop(copy.index(wordBeingChecked))

                    if wordBeingChecked not in foundWords.keys():
                        foundWords[wordBeingChecked] = []

                    foundWords[wordBeingChecked].append(j)

                    if len(copy) == 0:
                        substringIndexes.append(i)
                        break
                else:
                    break
            
            i += 1

        return substringIndexes

